    fun convertPngToBase64(path: String): String {
        val bitmap: Bitmap = BitmapFactory.decodeFile(path)
        val baos = ByteArrayOutputStream()
        bitmap.compress(Bitmap.CompressFormat.PNG, 100, baos)
        val byteArray: ByteArray = baos.toByteArray()
        return Base64.encodeToString(byteArray, Base64.DEFAULT)
    }

    fun getIPFSToken(uri : String){
        val client = OkHttpClient()

        val mediaType = MediaType.parse("multipart/form-data; boundary=---011000010111000001101001")
        val body = RequestBody.create(mediaType, "-----011000010111000001101001\r\nContent-Disposition: form-data; name=\"filePath\"\r\n\r\ndata:image/png;name=HackByte.png;base64,\r\n-----011000010111000001101001--\r\n\r\n")
        val request = Request.Builder()
            .url("https://api.verbwire.com/v1/nft/store/file")
            .post(body)
            .addHeader("accept", "application/json")
            .addHeader("content-type", "multipart/form-data; boundary=---011000010111000001101001")
            .build()

        val response = client.newCall(request).execute()
    }

